import React from "react";
import PropTypes from "prop-types";

function FruitCard(props) {
  return (
    <div className="fruitCard" style={{backgroundColor: props.background}}>
      <h2>{props.name}</h2>
      <p></p>
    </div>
  );
}

FruitCard.propTypes = {
  name: PropTypes.string.isRequired
};

export default FruitCard;
